import React from 'react';
import './App.css';
import {recipes} from './tempList';
import RecipeList from './components/RecipeList';
import RecipeDetail from './components/RecipeDetail';

function App() {
  return (
    <React.Fragment>
      <RecipeList />
      <RecipeDetail />
    </React.Fragment>
  );
}

export default App;
